import React, { useState, useEffect } from "react";
import mockData from "./mock_sample.json";
import "./ManCallPage.css";

function ManCalllistPage_CallistPage() {
  const [rowData, setRowData] = useState(null);

  // 통화 목록 데이터 추출 함수
  const extractCallListData = () => {
    // JSON 데이터에서 필요한 정보 추출
    const extractedData = mockData.map(
      ({ name, date, time, cluster, keyword }) => ({
        name,
        date,
        time,
        cluster,
        keyword: Array.isArray(keyword) ? keyword.join(" ") : keyword, // 키워드가 배열이 아닐 경우 문자열로 설정
      })
    );

    setRowData(extractedData); // 추출된 데이터 설정
  };

  // 페이지 렌더링 시 통화 목록 데이터 추출
  useEffect(() => {
    extractCallListData();
  }, []);

  return (
    <div>
      {/* 데이터가 존재하면 출력 */}
      {rowData && (
        <div>
          <table className="table-container">
            <thead>
              <tr>
                <th>이름</th>
                <th>날짜</th>
                <th>시간</th>
                <th>분류</th>
                <th>키워드</th>
              </tr>
            </thead>
            <tbody>
              {rowData.map((data, index) => (
                <tr key={index}>
                  <td>{data.name}</td>
                  <td>{data.date}</td>
                  <td>{data.time}</td>
                  <td>{data.cluster}</td>
                  <td>
                    {Array.isArray(data.keyword) && (
                      <div className="keyword-container">
                        {data.keyword.map((keyword, keywordIndex) => (
                          <div key={keywordIndex} className="keyword-box">
                            {keyword}
                          </div>
                        ))}
                      </div>
                    )}
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
}

export default ManCalllistPage_CallistPage;
